declare module "*.vue-router" {
    import Router from 'vue-router';
    export default Router;
}
declare module "*.vuex" {
    import Vuex from 'vuex';
    export default Vuex;
}
declare module "*.vue-i18n" {
    import VueI18n from 'vue-i18n';
    export default VueI18n;
}
declare module "*.vue" {
    import Vue from "vue";
    export default Vue;
}

declare module "*.chai" {
    import * as chai from "chai";
    export default chai;
}
